import React from 'react';
import './About.css'

function About() {
    return (
        <div classNameabout_container>
            <span>
                "Freedom is the freedom to say that two plus two make four. If thar is granted, all else follows"
            </span>
            <span>- George Orwell, 1984</span>
        </div>
    )
}

export default About;
